const COLORS: string[] = [
  '#6100FF',
  '#5065FD',
  '#36DBFF',
  '#5CFE9D',
  '#B1F13C',
  '#FF6F1E',
  '#F14544',
  '#FC72FF',
  '#C0C0C0',
  '#DD3B33',
  '#367B21',
  '#580DF5',
  '#F50DB4',
  '#A9862E',
  '#FF5A26',
  '#62D63E',
  '#608CF7',
  '#FC72FF',
  '#15B9FF',
  '#00F48E',
  '#A29790',
]

interface UniconProps {
  address: string // renamed to 'address'
  size?: number // Optional size prop
}

const Unicon: React.FC<UniconProps> = ({ address, size = 32 }) => {
  const hashValue = getDeterministicHash(address)

  const iconKeys = Object.keys(icons)
  const selectedIconPaths: IconPaths = icons[iconKeys[hashValue % iconKeys.length]]

  const colorToUse = COLORS[hashValue % 20]

  const ORIGINAL_CONTAINER_SIZE = 32

  const scaleValue = size / ORIGINAL_CONTAINER_SIZE / 1.5
  const scaledSVGSize = ORIGINAL_CONTAINER_SIZE * scaleValue
  const translateX = (size - scaledSVGSize) / 2
  const translateY = (size - scaledSVGSize) / 2

  return (
    <svg
      viewBox={'0 0 ' + size + ' ' + size}
      xmlns="http://www.w3.org/2000/svg"
      width={size}
      height={size} // Use the size prop to control SVG dimensions
    >
      <g transform-origin="center center">
        <circle cx={size / 2} cy={size / 2} r={size / 2} fill={colorToUse + '20'} />
        <g transform={`translate(${translateX}, ${translateY}) scale(${scaleValue})`}>
          {selectedIconPaths.map((pathData: string, index: number) => (
            <path key={index} d={pathData} fill={colorToUse} />
          ))}
        </g>
      </g>
    </svg>
  )
}

const getDeterministicHash = (address: string): number => {
  let hash = 0
  for (let i = 0; i < address.length; i++) {
    const char = address.charCodeAt(i)
    hash = (hash << 5) - hash + char
    hash |= 0
  }
  return Math.abs(hash)
}

export default Unicon
